"""
RefCast V1.0 — Installer / MacroScript Launcher
=================================================
HOW TO USE:
1. Paste your icon Base64 string in ICON_BASE64 below
2. Run this file ONCE in 3ds Max (Scripting > Run Script)
3. The plugin will be installed permanently
4. Find it in: Customize > Customize User Interface > Category: "Mostafa Tools"
5. Drag it to any toolbar, menu, or assign a hotkey

After installation, you can also launch it from:
   Scripting > Run Script > select RefCast_V1.py
"""

import os
import sys
import base64
import shutil

try:
    import pymxs
    rt = pymxs.runtime
    IN_MAX = True
except ImportError:
    IN_MAX = False
    print("ERROR: This script must be run inside 3ds Max.")
    sys.exit(1)

# ======================================================================
# ICON BASE64 — PASTE YOUR BASE64 STRING BETWEEN THE TRIPLE QUOTES
# ======================================================================
ICON_BASE64 = """"""  # <-- PASTE YOUR ICON BASE64 HERE (PNG, any size)
# ======================================================================

PLUGIN_NAME = "RefCast"
PLUGIN_VERSION = "1.0"
MACRO_CATEGORY = "Mostafa Tools"

def get_max_paths():
    """Get relevant 3ds Max directories."""
    user_scripts = rt.GetDir(rt.name("userScripts"))
    user_macros = rt.GetDir(rt.name("userMacros"))
    user_icons = rt.GetDir(rt.name("userIcons"))
    
    # Ensure directories exist
    for d in [user_scripts, user_macros, user_icons]:
        if not os.path.exists(d):
            os.makedirs(d, exist_ok=True)
    
    return user_scripts, user_macros, user_icons


def install_main_script(user_scripts):
    """Copy RefCast_V1.py to Max's user scripts folder."""
    src = os.path.join(os.path.dirname(os.path.abspath(__file__)), "RefCast_V1.py")
    dst = os.path.join(user_scripts, "RefCast_V1.py")
    
    if not os.path.exists(src):
        # If running from same folder, try current directory
        src = os.path.join(os.getcwd(), "RefCast_V1.py")
    
    if not os.path.exists(src):
        # Last resort: ask Max for the script directory it ran from
        print(f"[RefCast] WARNING: Could not find RefCast_V1.py automatically.")
        print(f"[RefCast] Please manually copy RefCast_V1.py to: {user_scripts}")
        return dst
    
    shutil.copy2(src, dst)
    print(f"[RefCast] Plugin copied to: {dst}")
    return dst


def install_icon(user_icons):
    """Decode base64 icon and save to Max's icon directory."""
    if not ICON_BASE64.strip():
        print("[RefCast] No icon Base64 provided — using default icon.")
        return False
    
    try:
        img_data = base64.b64decode(ICON_BASE64.strip())
        
        # Save as PNG first
        png_path = os.path.join(user_icons, f"{PLUGIN_NAME}_icon.png")
        with open(png_path, 'wb') as f:
            f.write(img_data)
        
        # 3ds Max macroScript icons need specific naming:
        #   <macroName>_24i.bmp  (24x24 color)
        #   <macroName>_24a.bmp  (24x24 alpha)
        # But modern Max (2020+) also supports PNG via iconName parameter
        
        print(f"[RefCast] Icon saved to: {png_path}")
        return True
        
    except Exception as e:
        print(f"[RefCast] Icon install failed: {e}")
        return False


def create_macroscript(user_macros, user_scripts, user_icons):
    """Create the .mcr macroScript file."""
    
    script_path = os.path.join(user_scripts, "RefCast_V1.py").replace("\\", "\\\\")
    icon_path = os.path.join(user_icons, f"{PLUGIN_NAME}_icon.png").replace("\\", "\\\\")
    
    has_icon = os.path.exists(icon_path.replace("\\\\", "\\"))
    
    # Build icon line
    icon_line = ""
    if has_icon:
        icon_line = f'\n    iconName:"{icon_path}"'
    
    mcr_content = f'''macroScript RefCast_Launch
    category:"{MACRO_CATEGORY}"
    toolTip:"RefCast — Reference Image Manager"
    buttonText:"RefCast"{icon_line}
(
    python.execute "
import importlib
import sys
import os

script_path = r'{script_path}'
script_dir = os.path.dirname(script_path)

if script_dir not in sys.path:
    sys.path.insert(0, script_dir)

if 'RefCast_V1' in sys.modules:
    importlib.reload(sys.modules['RefCast_V1'])
else:
    import RefCast_V1
"
)
'''
    
    mcr_path = os.path.join(user_macros, "RefCast_Launch.mcr")
    with open(mcr_path, 'w') as f:
        f.write(mcr_content)
    
    print(f"[RefCast] MacroScript created: {mcr_path}")
    return mcr_path


def register_macroscript(mcr_path):
    """Tell Max to load the macroScript immediately."""
    mcr_path_ms = mcr_path.replace("\\", "\\\\")
    rt.execute(f'fileIn @"{mcr_path_ms}"')
    print(f"[RefCast] MacroScript registered in '{MACRO_CATEGORY}' category.")


def run_installer():
    print("=" * 50)
    print(f"  {PLUGIN_NAME} V{PLUGIN_VERSION} — Installer")
    print("=" * 50)
    
    user_scripts, user_macros, user_icons = get_max_paths()
    
    # Step 1: Copy main plugin
    print("\n[1/4] Installing main plugin...")
    install_main_script(user_scripts)
    
    # Step 2: Install icon
    print("[2/4] Installing icon...")
    install_icon(user_icons)
    
    # Step 3: Create macroScript
    print("[3/4] Creating macroScript...")
    mcr_path = create_macroscript(user_macros, user_scripts, user_icons)
    
    # Step 4: Register
    print("[4/4] Registering in 3ds Max...")
    register_macroscript(mcr_path)
    
    print("\n" + "=" * 50)
    print("  INSTALLATION COMPLETE!")
    print("=" * 50)
    print(f"""
  The plugin is now installed permanently.

  TO ADD TO TOOLBAR:
    1. Customize > Customize User Interface
    2. Category: "{MACRO_CATEGORY}"
    3. Find "RefCast" and drag to any toolbar

  TO ASSIGN HOTKEY:
    1. Customize > Customize User Interface > Keyboard tab
    2. Category: "{MACRO_CATEGORY}"
    3. Select "RefCast_Launch" and assign a key

  TO RUN NOW:
    It should already be running!
""")
    
    # Auto-launch after install
    try:
        script_dir = os.path.join(user_scripts)
        if script_dir not in sys.path:
            sys.path.insert(0, script_dir)
        import RefCast_V1
    except Exception as e:
        print(f"[RefCast] Auto-launch note: {e}")
        print("[RefCast] Use the toolbar button or re-run the macro.")


# === RUN ===
if IN_MAX:
    run_installer()
